import React, { Component } from 'react'
import CourseWork from '../CourseWork/CourseWork'
import Typography from '@material-ui/core/Typography'


interface Props{
    changePage(event : React.MouseEvent<HTMLButtonElement>) : void,
    data :{}[]
}

interface State{

}

class CompletedWorks extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderCourseWork(work : {}){
        return (
            <div style={{marginBottom:'20px', border:'grey 1px solid', borderRadius:'10px'}}>
                <CourseWork data={work} changePage={this.props.changePage}/>
            </div>
        )
    }

    private renderList(){
        return(
            this.props.data.map( work => this.renderCourseWork(work))
        )
    }

    private renderEmptyList(){
        return(
            <div style={{textAlign:"center"}}>
                <Typography variant='h5'>Нет завершенных курсовых работ</Typography>
            </div>
        )
    }

    private isEmpty(obj : any) {
        return Object.keys(obj).length === 0;
    }

    render(){
        return (
        !this.isEmpty(this.props.data[0])?
            this.renderList()
        : this.renderEmptyList())

    }
}

export default CompletedWorks
